import User from "./User"


class Users extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            users : [
            {id:1,
            firstname: 'Bob',
            lastname: 'Matly',
            bio: 'A dsafhj a uythe abd jgkdfg',
            age: 40,
            isHappy: true

            },
            {
                id:2,
                firstname: 'John',
                lastname: 'Doe',
                bio: 'A dsafhj a uythe abd jgkdfg ddd asdwqeasd',
                age: 20,
                isHappy: false
                }

        ]
        }
    }

    render(){
        if(this.state.users.length > 0)
            return (<div>
                {this.state.users.map((el) => (
                    <User key={el.id} user={el}/>
                ))}
            </div>)
        else
        return(<div className='user'><h3>Not found</h3></div>)
    }
  }

  export default Users
